svg.script:
var selectedLine = 6;
var finalAngle = "42";
function doMouseOver(evt) {
    for (i = 0;  i <= 99;  i++) {
        zero = "zero" + i.toString();
        oner = "oner" + i.toString();
        oneg = "oneg" + i.toString();
        oneb = "oneb" + i.toString();
        twor = "twor" + i.toString();
        twog = "twog" + i.toString();
        twob = "twob" + i.toString();
        threer = "threer" + i.toString();
        threeg = "threeg" + i.toString();
        threeb = "threeb" + i.toString();
        if (i == selectedLine) {
            document.getElementById(zero).setAttribute("visibility", "visible");
            document.getElementById(oner).setAttribute("visibility", "visible");
            document.getElementById(oneg).setAttribute("visibility", "visible");
            document.getElementById(oneb).setAttribute("visibility", "visible");
            document.getElementById(twor).setAttribute("visibility", "visible");
            document.getElementById(twog).setAttribute("visibility", "visible");
            document.getElementById(twob).setAttribute("visibility", "visible");
            document.getElementById(threer).setAttribute("visibility", "visible");
            document.getElementById(threeg).setAttribute("visibility", "visible");
            document.getElementById(threeb).setAttribute("visibility", "visible");
        }
        else {
            document.getElementById(zero).setAttribute("visibility", "hidden");
            document.getElementById(oner).setAttribute("visibility", "hidden");
            document.getElementById(oneg).setAttribute("visibility", "hidden");
            document.getElementById(oneb).setAttribute("visibility", "hidden");
            document.getElementById(twor).setAttribute("visibility", "hidden");
            document.getElementById(twog).setAttribute("visibility", "hidden");
            document.getElementById(twob).setAttribute("visibility", "hidden");
            document.getElementById(threer).setAttribute("visibility", "hidden");
            document.getElementById(threeg).setAttribute("visibility", "hidden");
            document.getElementById(threeb).setAttribute("visibility", "hidden");
        }
    }
    if (finalAngle.substr(finalAngle.length-2, 2) == "42") {
        document.getElementById("degrees").firstChild.nodeValue = "final angle: " + finalAngle + " degrees (maximum)";
    }
    else {
        document.getElementById("degrees").firstChild.nodeValue = "final angle: " + finalAngle + " degrees";
    }
    document.getElementById("rollover").firstChild.nodeValue = " ";
}
